import logo from './logo.svg';
import './App.css';

import useCountry from './custom-hooks/useCountry';

function App() {
  const [errorCountries, allCountries] = useCountry();
  const [error, eesti] = useCountry("eesti");

  return (
    <div className="App">
      {console.log(allCountries)}
    </div>
  );
}

export default App;
